import axios from "axios";

export const getDrawingData = async () => {
  const req = await axios.get("localhost:9743/api/drawing/getData");
  console.log(req);
};

export const uploadDrawing = async () => {
  const req = await axios.post("localhost:9743/api/drawing/uploadData");
  console.log(req);
};
